FieldEntry.Formula:
LET $keys := HASH_KEYS([Methods]);
LET $len := ARRAY_LENGTH($keys);
LET $numberPerLine := 2; 
LET $lines := CEILING($len / $numberPerLine);

RETURN 
ARRAY_SELECT(
  RANGE(0, $lines), $(i, index) 
  LET $startingNumber := $numberPerLine * $index + 1; 
  RETURN
  ARRAY(
	ARRAY_INDEX($keys, $startingNumber),
    ARRAY_INDEX($keys, $startingNumber + 1)
  )
)

Binding.Expression:
LET $methods := [Methods];

RETURN 
	ARRAY_SELECT(
		HASH_KEYS($methods), $(i, item) 
		LET $methodData := HASH_GET($methods, $item);

		RETURN HASH("text",HASH_GET($methodData, "nice name"), "value", $item)
	)
